import { useState, useCallback } from "react";
import StudentMode from "../components/StudentMode";
import PortalPopup from "../components/PortalPopup";
import { useNavigate } from "react-router-dom";
import "./DASHBOARDParentModeForgotP.css";

const DASHBOARDParentModeForgotP = () => {
  const [isStudentModeOpen, setStudentModeOpen] = useState(false);
  const navigate = useNavigate();

  const onContactUsClick = useCallback(() => {
    navigate("/22-dashboard-parent-contact-us");
  }, [navigate]);

  const onGroupContainer1Click = useCallback(() => {
    navigate("/22-dashboard-parent-contact-us");
  }, [navigate]);

  const onProgressClick = useCallback(() => {
    navigate("/21-dashboard-parent-progress");
  }, [navigate]);

  const onGroupContainer2Click = useCallback(() => {
    navigate("/21-dashboard-parent-progress");
  }, [navigate]);

  const onCoursesClick = useCallback(() => {
    navigate("/22-dashboard-parent-courses");
  }, [navigate]);

  const onGroupContainer7Click = useCallback(() => {
    navigate("/22-dashboard-parent-courses");
  }, [navigate]);

  const onSettingsClick = useCallback(() => {
    navigate("/14-dashboard-parent-settings");
  }, [navigate]);

  const onGroupContainer9Click = useCallback(() => {
    navigate("/14-dashboard-parent-settings");
  }, [navigate]);

  const onGroupButtonClick = useCallback(() => {
    navigate("/20-dashboard-home-paretnt");
  }, [navigate]);

  const openStudentMode = useCallback(() => {
    setStudentModeOpen(true);
  }, []);

  const closeStudentMode = useCallback(() => {
    setStudentModeOpen(false);
  }, []);

  return (
    <>
      <div className="dashboard-parentmode-forgot-p">
        <div className="group-parent13">
          <div className="group-parent14">
            <div className="group-parent14">
              <div className="group-child20" />
              <div className="contact-us-parent2">
                <button className="contact-us5" onClick={onContactUsClick}>
                  <div
                    className="contact-us-child"
                    onClick={onGroupContainer1Click}
                  >
                    <div className="contact-us-parent3">
                      <div className="contact-us6">Contact Us</div>
                      <img className="vector-icon20" alt="" src="/vector.svg" />
                    </div>
                  </div>
                </button>
                <button className="progress6" onClick={onProgressClick}>
                  <div
                    className="vector-parent10"
                    onClick={onGroupContainer2Click}
                  >
                    <img className="vector-icon21" alt="" src="/vector1.svg" />
                    <div className="progress7">Progress</div>
                  </div>
                </button>
                <div className="vector-parent11">
                  <img className="vector-icon22" alt="" src="/vector2.svg" />
                  <div className="parent-mode5">Parent Mode</div>
                </div>
                <div className="home-parent2">
                  <div className="home5">Home</div>
                  <img className="vector-icon23" alt="" src="/vector3.svg" />
                </div>
              </div>
            </div>
            <button className="courses8" onClick={onCoursesClick}>
              <div className="vector-parent12" onClick={onGroupContainer7Click}>
                <img className="vector-icon24" alt="" src="/vector4.svg" />
                <div className="courses9">Courses</div>
              </div>
            </button>
          </div>
          <button className="settings10" onClick={onSettingsClick}>
            <div className="group-parent15" onClick={onGroupContainer9Click}>
              <img className="group-icon5" alt="" src="/group.svg" />
              <div className="settings11">Settings</div>
            </div>
          </button>
        </div>
        <div className="dashboard-parentmode-forgot-p-child" />
        <div className="dashboard-parentmode-forgot-p-inner">
          <div className="rectangle-wrapper1">
            <div className="group-child21" />
          </div>
        </div>
        <img
          className="microsoftteams-image-1-11"
          alt=""
          src="/microsoftteamsimage-1-1@2x.png"
        />
        <div className="dashboard-parentmode-forgot-p-item" />
        <img
          className="dashboard-parentmode-forgot-p-child1"
          alt=""
          src="/ellipse-13@2x.png"
        />
        <div className="marie2">
          <p className="marie3">Marie</p>
        </div>
        <div className="mother1">Mother</div>
        <img className="vector-icon25" alt="" src="/vector5.svg" />
        <img
          className="dashboard-parentmode-forgot-p-child2"
          alt=""
          src="/rectangle-921.svg"
        />
        <img
          className="dashboard-parentmode-forgot-p-child3"
          alt=""
          src="/rectangle-911.svg"
        />
        <button
          className="dashboard-parentmode-forgot-p-inner1"
          onClick={onGroupButtonClick}
        >
          <div className="continue-wrapper">
            <div className="continue">CONTINUE</div>
          </div>
        </button>
        <div className="you-have-successfully">
          YOU HAVE SUCCESSFULLY CHANGEd YOUR PASSWORD
        </div>
        <div className="ellipse-parent">
          <div className="ellipse-div" />
          <img className="image-47-icon" alt="" src="/image-47@2x.png" />
        </div>
        <button className="rectangle-parent17" onClick={openStudentMode}>
          <div className="group-child22" />
          <img className="group-child23" alt="" src="/ellipse-5.svg" />
        </button>
      </div>
      {isStudentModeOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeStudentMode}
        >
          <StudentMode onClose={closeStudentMode} />
        </PortalPopup>
      )}
    </>
  );
};

export default DASHBOARDParentModeForgotP;
